(function(){Template.__checkName("help"),Template.help=new Template("Template.help",function(){var e=this;return HTML.DIV({class:["container-fluid"," ","config"]},HTML.DIV({class:"row"},HTML.DIV({class:"col-xs-12"},HTML.DIV({class:"panel"},HTML.DIV({class:"panel-body"},HTML.HEAD(HTML.Raw('<meta charset="utf-8">'),"\n",HTML.TITLE("Untitled Document.md"),"\n",HTML.STYLE()),"\n",HTML.Raw('<body id="preview"><h1><a id="FlowBAT_0"></a>\nFlowBAT Help</h1>\n<hr>\n<p><a href="http://www.flowbat.com/">FlowBAT</a>\n is a graphical flow-based analysis tool. Utilizing the power and versatility of network flow records,\n<a href="http://www.flowbat.com/">FlowBAT</a>\n can help provide visibility for network administrators and network security practitioners.</p>\n<p>Whether you are a seasoned pro at using flow data or brand new to it, FlowBAT provides a user experience that should make it easy to rapidly track connections in to and out of your network. This includes</p>\n<ul><li>Investigating intrusion detection system alerts</li>\n<li>Tracking attacker activity through a network</li>\n<li>Troubleshooting network communication issues</li>\n<li>Learning more about the communication to/from devices on your network</li></ul>\n<h2><a id="ToC"></a>\nTable of Contents</h2>\n<hr>\n<h4><p style="white-space:pre;"><a href="#FlowBAT_0">FlowBAT</a>\n<a href="#Tech_10">Tech</a>\n<a href="#Count_40">Count</a>\n<a href="#Tech_10">Tech</a>\n<a href="#Installation_14">Installation</a>\n<a href="#Initial_Configuration_18">Initial Configuration</a></p></h4>\n<h5><p style="white-space:pre;"><a href="#SiLK_Site_Configuration_File_20">- SiLK Site Configuration File</a>\n<a href="#SiLK_Root_Directory_22">- SiLK Root Directory</a>\n<a href="#Temporary_Storage_Directory_24">- Temporary Storage Directory</a></p></h5>\n<h4><a href="#Basic_Usage_and_Best_Practices_27">Basic Usage and Best Practices</a></h4>\n<h5><p style="white-space:pre;"><a href="#Filters_31">- Filters</a>\n<a href="#Exclusions_38">- Exclusions</a>\n<a href="#Stats_45">- Stats</a>\n<a href="#Count_40">- Count</a>\n<a href="#IP_Sets_53">- IP Sets</a>\n<a href="#Tuple_Files_56">- Tuple Files</a>\n<a href="#PCAP_Analysis">- PCAP Analysis</a>\n<a href="#RWF_Analysis">- RWF Analysis</a></p></h5>\n<h4><a href="#Layout_59">Layout</a></h4>\n<h5><p style="white-space:pre;"><a href="#Dashboard_69">- Dashboard</a>\n<a href="#Quick_Query_72">- Quick Query</a>\n<a href="#Saved_Queries_75">- Saved Queries</a>\n<a href="#IP_Sets_78">- IP Sets</a>\n<a href="#Tuple_Files_81">- Tuple Files</a>\n<a href="#Night_Mode">- Night Mode</a>\n<a href="#Configuration_Settings_84">- Configuration Settings</a>\n<a href="#User_Administration_86">- User Administration</a>\n<a href="#SiLK_Server_Administration_88">- SiLK Server Administration</a>\n<a href="#Help_90">- Help</a></p></h5>\n<h4><a href="#Query_Examples_94">QueryExamples</a>\n<a href="#Additional_Notes_115">Additional Notes</a></h4>\n<h5><p style="white-space:pre;"><a href="#Standards_117">- Standards</a>\n<a href="#HTTPS_123">- HTTPS</a></p></h5>\n<h4><a href="#Support_126">Support</a>\n<a href="#License_135">License</a></h4>\n<h3><a id="Tech_10"></a>\nTech</h3>\n<hr>\n<p><a href="http://www.flowbat.com/">FlowBAT</a>\n is written in Node.js using the Meteor framework. It is designed to work along side an existing\n<a href="https://tools.netsa.cert.org/silk/">SiLK</a>\n-based NetFlow system, or to be installed in conjunction with one.\n<a href="http://www.flowbat.com/">FlowBAT</a>\n was written with ease of installation and deployment in mind.</p>\n<h3><a id="Installation_14"></a>\nInstallation</h3>\n<hr>\n<p>If youre reading this, you probably already succeeded at installing\n<a href="http://www.flowbat.com/">FlowBAT</a>\n. However, if you are perhaps not the installer and are looking to check out what went into getting this running, check out the\n<a href="http://www.flowbat.com/installation.html">installation</a>\n documentation. It was probably just two scripts and maybe some manually configuration editing of sensor.conf and silk.conf.</p>\n<h3><a id="Initial_Configuration_18"></a>\nInitial Configuration</h3>\n<hr>\n<h4><a id="SiLK_Site_Configuration_File_20"></a>\nSiLK Site Configuration File</h4>\n<p>This is the main configuration file that SiLK uses to interpret your sensor deployment. If youve installed using the scripts provided at\n<a href="http://www.flowbat.com/">FlowBAT</a>\n.com then it is /data/silk.conf</p>\n<h4><a id="SiLK_Root_Directory_22"></a>\nSiLK Root Directory</h4>\n<p>This is the directory where you are storing flow data on the SiLK server. If youve installed using the scripts provided at\n<a href="http://www.flowbat.com/">FlowBAT</a>\n.com then it is /data/</p>\n<h4><a id="Temporary_Storage_Directory_24"></a>\nTemporary Storage Directory</h4>\n<p>This is where temporary files, sets, rwf files, and generally anything else that FlowBAT needs to make and use later will be stored. It is easy to want to use /tmp/ as the directory but due to how the filesystem cleans it up regularly, it is not recommended. Instead, create a directory that you can manually control if needed.</p>\n<h3><a id="Basic_Usage_and_Best_Practices_27"></a>\nBasic Usage and Best Practices</h3>\n<hr>\n<p><a href="http://www.flowbat.com/">FlowBAT</a>\n can be used to search for flows, perform stats against user defined bins of flow data, or it can be used to count flows of a certain type and put them in timebased bins for a time based analysis. The record results are presented as a customizable table where columns can be moved around via mouse, and fields can be removed using selection boxes below the table. Single clicking a column will all data on the table in an ascending or descending order based on the column clicked. Every value in the table has a pivot capability when clicked. For instance, timestamps can be used to further customize the filter by adding a Before/After 1 minute to the filter simply by clicking and pivoting off of the user selected time in the table. IP addresses have lookup features in Robtex. More sources are being added via updates.\n<em>Stats</em>\n and\n<em>Count</em>\n output types can be presented as either a table or a chart.\n<em>Stats</em>\n is based on\n<a href="https://tools.netsa.cert.org/silk/rwstats.html">rwstats</a>\n and the tables have limited pivoting available for\n<em>Stats Fields</em>\n.\n<em>Count</em>\n is based on\n<a href="https://tools.netsa.cert.org/silk/rwcount.html">rwcount</a>\n and has static table output as well as line chart output. For more details on\n<em>Stats</em>\n and\n<em>Count</em>\n usage, see below.</p>\n<h4><a id="Filters_31"></a>\nFilters</h4>\n<p>The most common usage of FlowBAT will be to use filters to search for specific flows from a SiLK datastore. The syntax for a query is implicitly AND, meaning that every record in a result will be a match of the combined result of all user provided options in the query. The goal is always to narrow down to smaller results via\n<em>filters</em>\n, and then you can do more specific carving using\n<em>exclusions</em>\n. Lets say that you are looking for traffic where either address is 192.168.1.15. Your filter will be as simple as:</p>\n<pre><code>--any-address=192.168.1.15 --type=all</code></pre>\n<p>The\n<em>any-address</em>\n option says to look for 192.168.1.15 in source or destination IP address fields. The\n<em>type</em>\n option is an input option that states that we want to look in all forms of traffic whether it is inbound, outbound, or internal to internal traffic. In this case the\n<em>type</em>\n is redundant though due to liberties taken in FlowBAT to meet more common user use cases. We default to all for the\n<em>type</em>\n field. See Other Notes at the end of this documentation for more detail.</p>\n<h4><a id="Exclusions_38"></a>\nExclusions</h4>\n<p><em>Exclusions</em>\n are used to narrow a filters results. Think of exclusions as doing an equal and opposite feature of filtering. Assume that you have a fair amount of SSH traffic and Google Hangouts traffic that is overwhelming a specific search. Hypothetically the following exclusion would remove records from the results that have [a source IP address of 192.168.1.15 and a source address of port 22] OR [UDP records with some local source IP addresses that looks like Google Hangouts traffic on ports 19302 through 19309]. You could write an exclusion as such:</p>\n<pre><code>--saddress=192.168.1.15 --sport=22 OR --protocol=17 --scidr=192.168.0.0/16 --dcidr=173.194.0.0/16,74.125.0.0/16 --aport=19302-19309</code></pre>\n<p>If youre wanting to look for large groupings of IP addresses, youll want to generate IP sets. Please refer to the IP Sets section for more information. When filters alone wont accomplish some goals of pulling very specific 5-tuple combinations, we allow the creation of 5-tuple files for use in the query builder. See Tuple Files for more information.</p>\n<h4><a id="Stats_45"></a>\nStats</h4>\n<p><em>Stats</em>\n is based on\n<a href="https://tools.netsa.cert.org/silk/rwstats.html">rwstats</a>\n and is used to calculate top-n/bottom-n lists based on user definied fields and stat values.\n<em>Stats</em>\n is best explained via examples and the best practice is usually to try to put into words what you are looking for first. For instance, you are looking for the [top 10 sIP-dIP pairs by bytes]. In this case you would specify Top, Count=10, select Source IP and Dest IP as fields, and select Bytes as the\n<em>Stats Value</em>\n. Multiple\n<em>Stats Values</em>\n can be selected as long as the value does not match the field being searched for. In the event that you are pulling muliple stat values, youll want to select the *Primary Stats Value" that is most important to you. The other fields will be supplementary information, but will not be the main values being used to calculate against.</p>\n<p>Table output allows for pivoting on certain\n<em>stats fields</em>\n but not on\n<em>stats values</em>\n. You can select between bar, column, and pie charts for the chart display. The chart uses a logarithmic scale due to the widely varying values when using multiple\n<em>stats values</em></p>\n<h4><a id="Count_40"></a>\nCount</h4>\n<p><em>Count</em>\n is based on\n<a href="https://tools.netsa.cert.org/silk/rwcount.html">rwcount</a>\n and is used to summarize flow records over time, grouping record, byte, and packet counts into time bins of a user defined duration. Each row in the table output each data point on the line chart output represents one bin. If the user uses a 60 second bin size (the default is 30 seconds) this means that the total number of records/minute, bytes/minute, and packets/minute. Special considerations need to be taken when making charts with rwcount. If the time range specified is incredible long and the bin size is unreasonably small for that range, the chart will take a long time to create and it will be illegible if it actually appears. This is because you are loading the entire dataset onto one chart.</p>\n<h4><a id="IP_Sets_53"></a>\nIP Sets</h4>\n<p><em>IP Sets</em>\n are user defined lists of IP addresses that can be edited in the IP Sets tab in the navbar at the top of the screen. There you will create an IP set that can be IP addresses, CIDR ranges, or combinations of the two. Saving the results will allow you to specify those sets in the query builder under the host subheading. As before, selecting\n<em>any IP set</em>\n will add the\n<em>anyset</em>\n option to the query. That option looks for any match from the sets, regardless if they occur as the source or destination IP address.</p>\n<h4><a id="Tuple_Files_56"></a>\nTuple Files</h4>\n<p><em>Tuple Files</em>\n allow you to specify up to an entire 5-tuple to search for, and by default it will search in any direction. This means that if you choose to only look for communications between two addresses, you can specify them in the file as something like 192.168.1.15,8.8.8.8. You can save as many tuples as you would like in the file (just as you did in IP Sets), but specifying the options in the query builder is slightly more complex to give you more power in filtering. Under the additional options subheading in the query builder youll find Tuple File, Tuple Direction, Tuple Delimiter, and Tuple Fields. After selecting the tuple file that youve created, the tuple direction refers to what order you wish to search in. Selecting both will search for any occurence of the tuple elements regardless of where they appear in the individual record. This is the most common use case as it accomplishes a task that isnt easily specified in default options. After specifying direction, you need to tell FlowBAT how the tuple file is formatted. Provide the delimiter that you chose (in this example we are using a comma\n<strong>,</strong>\n), and tell FlowBAT what the elements are in the tuple. In this case, we can say\n<strong>sip,dip</strong>\n. If weve chosen the tuple direction to be both, this really just implies that both of the values are IP addresses. Had we chosen otherwise, the sip,dip would have more meaning. Also, had we provided the full 5-tuple we might have used\n<strong>sip,dip,sport,dport,protocol</strong>\n to define the tuple fields.</p>\n<h4><a id="PCAP_Analysis"></a>\nPCAP Analysis</h4>\n<p>PCAP analysis can be performed in FlowBAT by specifying the full path of the file at either the command line FlowBAT interface or the "Additional Options" tab. See the examples at the end of this documentation for more details.</p>\n<pre><code>/home/jason/badguys.pcap --saddress=192.168.1.15 --aport=31337</code></pre>\n<h4><a id="RWF_Analysis"></a>\nRWF Analysis</h4>\n<p>RWF files are the binary files that SiLK tools operate on. These can also be created at the command line in cases where automation might be desired. If you need to review an rwf file in FlowBAT, simply specify it prior to the rest of the filter. </p>\n<pre><code>/home/jason/IOT.rwf --type=out,outweb --packets=4- --ack-flag=1</code></pre>\n<h3><a id="Layout_59"></a>\nLayout</h3>\n<hr>\n<p><a href="http://www.flowbat.com/">FlowBAT</a>\n was created to be a more user-friendly frontend for the SiLK flow analysis tool suite. Seasoned professionals will notice that many tools are not immediately available to use, but instead have been packaged together in an effort to meet the most common SiLK analysis use-cases.\n<a href="http://www.flowbat.com/">FlowBAT</a>\n allows the user to search and filter for flow data as well as run statistics based on the outputs. The main FlowBAT Interface is divided into six main sections:</p>\n<ul><li>Dashboard</li>\n<li>Quick Query</li>\n<li>Saved Queries</li>\n<li>IP Sets</li>\n<li>Tuple Files</li>\n<li>Configuration Settings</li></ul>\n<h4><a id="Dashboard_69"></a>\nDashboard</h4>\n<p>If this is your first time booting up\n<a href="http://www.flowbat.com/">FlowBAT</a>\n you might notice that the dashboard is a plain canvas. This is a place to put the output of saved queries. Those outputs might be bandwidth graphs or tables of records with interactions with malicious IP sets, or generally just anything you want. In order to make them actionable in a dashboard, youll want to make sure that the outputs are updated, so make sure that the intended queries have rolling times and periodic execution. At the top of the Dashboard is a quick query command interface input. This input allows for running a search spontaneously without navigating manually to other tabs. For the query builder, you will need to go to\n<em>quick query</em>\n or\n<em>saved queries</em>\n.</p>\n<h4><a id="Quick_Query_72"></a>\nQuick Query</h4>\n<p>Running a quick query is useful when you are just doing some regular hunting or providing situational awareness upon request. If it is something that you dont think that you will keep, then quick query is the place to go. However, in the event that you just love something youve found, you can go ahead and make it a saved query on the fly from the quick query page. In the event that you cannot filter exactly how you want, or perhaps there is an outlier that you also want removed, you can also provide exclusions which will remove data from your results. See Basic Usage and Best Practices. There is also a query builder that provides individual descriptions and input fields for those not verse in SiLK syntax already. Each input contains a help bubble that can assist in understanding what fields mean. Upon adding fields in the query builder, the full SiLK query itself (in red) is populated below the input parameters. New users can take note of the syntax to ween themselves off of the query builder and opt to make use of quick query for a more streamlined experience.</p>\n<h4><a id="Saved_Queries_75"></a>\nSaved Queries</h4>\n<p>The\n<em>Saved Queries</em>\n tab shows all queries that you have saved. This tab also provides the actual SiLK queries needed to replicate from the command line on the server itself (useful for those wanting to learn SiLK syntax and run automated tasks against flow data). Query names in this list are referenced when selecting outputs to display on the dashboard.</p>\n<h4><a id="IP_Sets_78"></a>\nIP Sets</h4>\n<p>Here you can create an IP set that can be IP addresses, CIDR ranges, or combinations of the two. Saving the results will allow you to specify those sets in the query builder under the host subheading. When creating IP sets it is recommended that you leave a note descibing the set and have a unique IP set name. The name will be referenced in the query builder. See Basic Usage and Best Practices for more details.</p>\n<h4><a id="Tuple_Files_81"></a>\nTuple Files</h4>\n<p>Here you can create a tuple file (see Basic Usage and Best Practices for more details on these unique files). Saving the results will allow you to specify those tuples in the query builder under the Additional options subheading. When creating tuple files it is recommended that you leave a note descibing the file and have a unique name. The name will be referenced in the query builder. See Basic Usage and Best Practices for more details.</p>\n<h4><a id="Night_Mode"></a>\nNight Mode</h4>\n<p>Night Mode changes the visual theme of FlowBAT to make it easier on the eyes in darker environments. Simple click the sun/moon symbol to toggle. Night Mode is only available on webkit enabled browsers (Chrome, Safari, Opera).</p>\n<h4><a id="Configuration_Settings_84"></a>\nConfiguration Settings</h4>\n<p>These are options available to all users.</p>\n<h5><a id="User_Administration_86"></a>\n- User Administration</h5>\n<p>Add, remove, or edit users.</p>\n<h5><a id="SiLK_Server_Administration_88"></a>\n- SiLK Server Administration</h5>\n<p>Change initial FlowBAT configuration options such as silk.conf location, data directory, temporary storage directory, and SSH options. See Initial Configuration for more details.</p>\n<h5><a id="Help_90"></a>\n- Help</h5>\n<p>You are here.</p>\n<h3><a id="Query_Examples_94"></a>\nQuery Examples</h3>\n<hr>\n<p>Search for all records with IP address 192.168.1.15 as either source IP or dest IP</p>\n<pre><code>Filter: --any-address=192.168.1.15</code></pre>\n<p>Search for 192.168.1.15 but only show outbound flows</p>\n<pre><code>Filter: --any-address=192.168.1.15 --type=out,outweb</code></pre>\n<p>Look at the top 10 source-dest ip pairs with stats by bytes</p>\n<pre><code>Filter: --protocol=0-255\nStats: --top --count=10 --fields=sip,dip --values=bytes</code></pre>\n<p>Look at the top 10 list of destination country codes for outbound traffic by packets, excluding the United States, Great Britain, and private IP space</p>\n<pre><code>Filter: --protocol=0-255 --type=out,outweb\nExclusion: --dcc=US,GB,--\nStats: --top --count=10 --fields=dcc --values=packets</code></pre>\n<p>Examine a pre-made RWF file of IoT traffic to determine how much outbound data is traversing the network.</p>\n<pre><code>Filter: /home/jason/IOT.rwf --type=out,outweb --packets=4- --ack-flag=1\nCount: --bin-size=60</code></pre>\n<p>Examine a PCAP file to generate a list of the top talking sip-dip pairs by bytes.</p>\n<pre><code>Filter: /home/jason/badguys.pcap --protocol=0-255\nStats --top --count=10 --fields=sip,dip --values=bytes</code></pre>\n<h3><a id="Additional_Notes_115"></a>\nAdditional Notes</h3>\n<hr>\n<h4><a id="Standards_117"></a>\nStandards</h4>\n<p><a href="http://www.flowbat.com/">FlowBAT</a>\n makes every attempt at keeping most of the standards set by\n<a href="https://tools.netsa.cert.org/silk/">SiLK</a>\n and only deviates when it is in the analysts best interest. The most significant change is regarding the\n<em>type</em>\n default values when creating a filter. If youre a veteran of SiLK youll probably know that SiLK defaults to incoming traffic as per the\n<a href="https://tools.netsa.cert.org/silk/rwfilter.html">rwfilter</a>\n documentation:</p>\n<blockquote><p>The default-type list is determined by the value of CLASS, and the default types generally include only incoming traffic.</p></blockquote>\n<p>In our experience analysts generally intend to start searching by looking through all flows collected and as such\n<strong>we have made all the default value for\n<em>type</em></strong>\n.</p>\n<h4><a id="HTTPS_123"></a>\nHTTPS</h4>\n<p>We have also provided a script in the support folder of the project that allows the user to quickly set up an nginx proxy for https access. This script is only meant to ensure that connections made to FlowBAT are encrypted, but as with any security measures, you should customize the proxy configuration to your own liking if you desire any more than what is described here.</p>\n<h3><a id="Support_126"></a>\nSupport</h3>\n<hr>\n<p>Dont hesitate to email\n<a href="support@flowbat.com">support</a>\n if you have any questions or feature requests about\n<a href="http://www.flowbat.com/">FlowBAT</a>\n. You can also submit\n<a href="https://github.com/chrissanders/FlowBAT/issues">issues</a>\n if you feel inclined to submit bugs or requests via github.</p>\n<p>For more information on\n<a href="https://tools.netsa.cert.org/silk/">SiLK</a>\n please see the [SiLK documentation] and for tool specific documentation, see the following</p>\n<ul><li><a href="https://tools.netsa.cert.org/silk/rwfilter.html">rwfilter</a></li>\n<li><a href="https://tools.netsa.cert.org/silk/rwstats.html">rwstats</a></li>\n<li><a href="https://tools.netsa.cert.org/silk/rwcount.html">rwcount</a></li></ul>\n<h3><a id="License_135"></a>\nLicense</h3>\n<p>Refer to the\n<a href="https://github.com/chrissanders/FlowBAT/blob/master/LICENSE.md">license</a>\n on the project page.</p></body>'))))))})}).call(this);

